function screen11_addBtns(){
	//removes all existing listnerers of this type
	exportRoot.screen11.btn_weakness.removeAllEventListeners("mousedown"); 
	exportRoot.screen11.btn_dehydration.removeAllEventListeners("mousedown"); 
	exportRoot.screen11.btn_vomiting.removeAllEventListeners("mousedown"); 
	exportRoot.screen11.btn_urinating.removeAllEventListeners("mousedown"); 
	exportRoot.screen11.btn_heavy_breathing.removeAllEventListeners("mousedown"); 

	//establishing names
	exportRoot.screen11.btn_weakness.name = "weakness";
	exportRoot.screen11.btn_dehydration.name = "dehydration";
	exportRoot.screen11.btn_vomiting.name = "vomiting";
	exportRoot.screen11.btn_urinating.name = "urinating";
	exportRoot.screen11.btn_heavy_breathing.name = "heavy_breathing";	
		
	//new event listeners
	exportRoot.screen11.btn_weakness.addEventListener("mousedown", screen11_changeKara);
	exportRoot.screen11.btn_dehydration.addEventListener("mousedown", screen11_changeKara);
	exportRoot.screen11.btn_vomiting.addEventListener("mousedown", screen11_changeKara);
	exportRoot.screen11.btn_urinating.addEventListener("mousedown", screen11_changeKara);
	exportRoot.screen11.btn_heavy_breathing.addEventListener("mousedown", screen11_changeKara);
	
	//add hand hovers
	addHandHover(exportRoot.screen11.btn_weakness);
	addHandHover(exportRoot.screen11.btn_dehydration);
	addHandHover(exportRoot.screen11.btn_vomiting);
	addHandHover(exportRoot.screen11.btn_urinating);
	addHandHover(exportRoot.screen11.btn_heavy_breathing);
}

function screen11_triggerSymptoms(){
			
	screen11TM_urinating = setTimeout(function(){
		//console.log("trigger uriation");
		exportRoot.screen11.kara.gotoAndPlay("urinating");
	}, 4000);
	
	screen11TM_weakness = setTimeout(function(){	
		//console.log("trigger weakness");
		exportRoot.screen11.kara.gotoAndPlay("weakness");
	}, 5500);
	
	
	screen11TM_dehydration = setTimeout(function(){
		//console.log("trigger dehydration");
		exportRoot.screen11.kara.gotoAndPlay("dehydration");
	}, 6200);
	
	
	screen11TM_vomiting = setTimeout(function(){
		//console.log("trigger vomiting");
		exportRoot.screen11.kara.gotoAndPlay("vomiting");
	}, 7500);
	
	
	screen11TM_heavybreathing = setTimeout(function(){
		//console.log("trigger heavybreathing");
		exportRoot.screen11.kara.gotoAndStop("heavy_breathing");
		screen11_addBtns(); //allow interactivity after all audio finishes
	}, 8500);
		
}

