function screen12_grabbedSound(e){
	playSfx("click6");
}

function screen12_dragMeter(e){
	end_pulseObj(screen12_meter);
	screen12_meter.x = stage.mouseX  + screen12_meter_diffX;
	screen12_meter.y = stage.mouseY + screen12_meter_diffY;
	
	var diffX=Math.abs(stage.mouseX - screen12_meter.targetX);
	var diffY=Math.abs(stage.mouseY - screen12_meter.targetY);
	
	if(diffX<screen12_dragThresh  && diffY<screen12_dragThresh ){
		//console.log("meter on kara!");
		
		screen12_meter.removeAllEventListeners("pressmove");
		screen12_meter.removeAllEventListeners("pressup");
		
		screen12_resetMeter();
		//screen12_meter.visible=false;
			
		//onto frame1
		exportRoot.screen12.gotoAndPlay("call"); //next frame
		setTimeout(screen12_setupPhone, 10); //slight delay so new frame is called first
	}
}


function screen12_resetMeter(e){
	screen12_meter.x = screen12_meter.initX;
	screen12_meter.y = screen12_meter.initY;	
}



