screen12_setupPhone = function(){
	screen12_phone = exportRoot.screen12.phone;
	screen12_phone.x = screen12_phone.initX ||screen12_phone.x;
	screen12_phone.y = screen12_phone.initY ||screen12_phone.y;
	screen12_phone.initX = screen12_phone.x;
	screen12_phone.initY = screen12_phone.y;
	
	screen12_phone_diffX = -430;
	screen12_phone_diffY = -150;
	screen12_phone.targetX = 383;
	screen12_phone.targetY = 258;
	screen12_phone.visible=true;
	
	screen12_phone.removeAllEventListeners("pressmove"); //removes all existing listnerers of this type
	screen12_phone.removeAllEventListeners("pressup");
	screen12_phone.addEventListener("pressmove", screen12_dragPhone);
	screen12_phone.addEventListener("pressup", screen12_resetPhone);
	screen12_phone.removeAllEventListeners("mousedown");
	screen12_phone.addEventListener("mousedown", screen12_grabbedSound);	
	addHandHover(screen12_phone);
		
}


function screen12_dragPhone(e){
	end_pulseObj(screen12_phone);
	screen12_phone.x = stage.mouseX  + screen12_phone_diffX;
	screen12_phone.y = stage.mouseY + screen12_phone_diffY;
	
	var diffX=Math.abs(stage.mouseX - screen12_phone.targetX);
	var diffY=Math.abs(stage.mouseY - screen12_phone.targetY);
	
	if(diffX<screen12_dragThresh  && diffY<screen12_dragThresh ){
		//console.log("phone on kara!");
		
		screen12_phone.removeAllEventListeners("pressmove");
		screen12_phone.removeAllEventListeners("pressup");
		
		screen12_resetPhone();
		//screen12_phone.visible=false;
			
		//onto frame1
		exportRoot.screen12.gotoAndPlay("waterinsulin"); //next frame
		setTimeout(screen12_setup_waterinsulin, 10); //slight delay so new frame is called first
	}
}


function screen12_resetPhone(e){
	screen12_phone.x = screen12_phone.initX;
	screen12_phone.y = screen12_phone.initY;	
}


