function screen12_dragWater(e){
	end_pulseObj(screen12_water);
	screen12_water.x = stage.mouseX + screen12_water_diffX;
	screen12_water.y = stage.mouseY + screen12_water_diffY;
	
	var diffX = Math.abs(screen12_water.targetX - stage.mouseX);
	var diffY = Math.abs(screen12_water.targetY - stage.mouseY);
	
	if(diffX<screen12_dragThresh  && diffY<screen12_dragThresh ){
		//console.log("water on kara!");
		playSfx("drinkwater");
		
		exportRoot.screen12.kara.gotoAndStop("water");
		screen12_water.removeAllEventListeners("pressmove");
		screen12_water.removeAllEventListeners("pressup");
		
		screen12_water.visible=false;
		
		//if water & insulin is also invisible, move on.
		if(!screen12_water.visible && !screen12_insulin.visible){
			//go to final "better" screen after short delay
			setTimeout(function(){
				screen12_resetWater();
				screen12_resetInsulin();
				exportRoot.screen12.gotoAndPlay("better");
			}, 2000);			
		}
		
	}
}

function screen12_resetWater(e){
	screen12_water.x = screen12_water.initX;
	screen12_water.y = screen12_water.initY;
}

function screen12_dragInsulin(e){
	end_pulseObj(screen12_insulin);
	screen12_insulin.x = stage.mouseX + screen12_insulin_diffX;
	screen12_insulin.y = stage.mouseY + screen12_insulin_diffY;
	
	var diffX = Math.abs(screen12_insulin.targetX - stage.mouseX);
	var diffY = Math.abs(screen12_insulin.targetY - stage.mouseY);
	
	if(diffX<screen12_dragThresh  && diffY<screen12_dragThresh ){
		//console.log("insulin on kara!");
		
		exportRoot.screen12.kara.gotoAndStop("insulin");
		screen12_insulin.removeAllEventListeners("pressmove");
		screen12_insulin.removeAllEventListeners("pressup");
		
		screen12_insulin.visible=false;

		//if water & insulin is also invisible, move on.
		if(!screen12_water.visible && !screen12_insulin.visible){
			//go to final "better" screen after short delay
			setTimeout(function(){
				screen12_resetWater();
				screen12_resetInsulin();
				exportRoot.screen12.gotoAndPlay("better");
			}, 2000);			
		}
	}
}

function screen12_resetInsulin(e){
