function btn_next_clicked(e){
	sndch.stop(); //stop narration
	stopSfx(); //stop playing sfx
	playSfx('sfx_btnclick');
	
	//console.log("--------");
	//console.log("btn_next_clicked");
	//console.log("leaving currentLabel: " + exportRoot.getCurrentLabel() );
	
	
	switch( exportRoot.getCurrentLabel() ){
		case "screen1":{
			exportRoot.gotoAndStop("screen2");
			break;
		}
		case "screen2":{
			exportRoot.gotoAndStop("screen3");
			break;
		}
		case "screen3":{
			exportRoot.gotoAndPlay("trans34"); break;
			break;
		}
		case "screen4":{
			screen4_killPulses();
			exportRoot.gotoAndStop("screen5");			
			screen4_cell.gotoAndStop("normal_locked"); //cell starts at its first state
			break;
		}
		
		case "screen5":{
			exportRoot.gotoAndPlay("trans56"); break;			
			break;
		}
		case "screen6":{
			//exportRoot.gotoAndStop("screen7");
			exportRoot.gotoAndStop("screen8");
			break;
		}
		
		//screen7 no longer exists
		case "screen7":{
			exportRoot.gotoAndStop("screen8");			
			break;
		}
		//

		case "screen8":{
			exportRoot.gotoAndStop("screen9");			
			break;
		}

		
		case "screen9":{
			exportRoot.gotoAndStop("screen10");			
			break;
		}

		case "screen10":{
			exportRoot.gotoAndStop("screen11");			
			break;
		}

		case "screen11":{
			screen11_clearTimeouts();
			exportRoot.gotoAndStop("screen12");			
			break;
		}

		//if in screen12, stepping through its MC a few times before advancing to screen13
		case "screen12":{
			//alert( exportRoot.screen12.getCurrentLabel() );
			screen12_resetAll();
			
			if(exportRoot.screen12.getCurrentLabel()=="checkketones"){
				end_pulseObj(screen12_meter);
				exportRoot.screen12.gotoAndPlay("call");
				setTimeout(screen12_setupPhone, 10); //slight delay so new frame is called first	
			}
			
			else if(exportRoot.screen12.getCurrentLabel()=="call" || exportRoot.screen12.getCurrentLabel()=="call_end"){
				end_pulseObj(screen12_phone);
				exportRoot.screen12.gotoAndPlay("waterinsulin");
				setTimeout(screen12_setup_waterinsulin, 10); //slight delay so new frame is called first	
			} 
			else if(exportRoot.screen12.getCurrentLabel()=="waterinsulin" || exportRoot.screen12.getCurrentLabel()=="waterinsulin_end"){
				end_pulseObj(screen12_water);				
				end_pulseObj(screen12_insulin);
				exportRoot.screen12.gotoAndPlay("better");
			}
			else if(exportRoot.screen12.getCurrentLabel()=="better") exportRoot.gotoAndStop("screen13");			
			else exportRoot.gotoAndStop("screen13");			
		
			//update the bottom text
			setTimeout(change_storytext, 10);
			
			break;
		}

		case "screen13":{
			exportRoot.gotoAndStop("screen14");			
			break;
		}
		case "screen14":{
			exportRoot.gotoAndStop("screen15");			
			break;
		}

		
		default:
			//console.log("don't know where to go!");
		break;
	}
	
	//change_storytext(); //in storytext.js
}

function btn_prev_clicked(e){
	sndch.stop();
	stopSfx(); //stop playing sfx
	playSfx('sfx_btnclick');
	
	//console.log("--------");
	//console.log("btn_prev_clicked");
	//console.log("leaving currentLabel: " + exportRoot.getCurrentLabel() );	
	
	switch( exportRoot.getCurrentLabel() ){
		//case "screen5": exportRoot.gotoAndPlay("trans56"); break;

		case "screen2":{
			exportRoot.gotoAndStop("screen1");
			break;
		}

		case "screen3":{
			exportRoot.gotoAndStop("screen2");
			break;
		}

		case "screen4":{
			screen4_killPulses();
			exportRoot.gotoAndStop("screen3");
			screen4_cell.gotoAndStop("normal_locked"); //cell starts at its first state
			break;
		}

		
		case "screen5":{
			exportRoot.gotoAndStop("screen4");
			break;
		}

		case "screen6":{			
			exportRoot.gotoAndStop("screen5");
			break;
		}
		
		//screen7 no longer exists
		case "screen7":{
			exportRoot.gotoAndStop("screen6");			
			break;
		}
		//

		case "screen8":{
			//exportRoot.gotoAndStop("screen7");
			exportRoot.gotoAndStop("screen6");
			break;
		}

		case "screen9":{
			exportRoot.gotoAndStop("screen8");
			break;
		}

		case "screen10":{
			exportRoot.gotoAndStop("screen9");
			break;
		}

		case "screen11":{
			screen11_clearTimeouts();
			exportRoot.gotoAndStop("screen10");
			break;
		}

		case "screen12":{
			screen12_resetAll();
			exportRoot.gotoAndStop("screen11");
			break;
		}
		case "screen13":{
			exportRoot.gotoAndStop("screen12");
			exportRoot.screen12.gotoAndStop("checkketones");
			break;
		}
		case "screen14":{
			exportRoot.gotoAndStop("screen13");
			break;
		}
		case "screen15":{
			exportRoot.gotoAndStop("screen14");
			break;
		}

		default: 
			//console.log("don't know where to go!"); 
		break;
	}
	
	//change_storytext(); //in storytext.js
}




