screen11_clearTimeouts = function(){
	//console.log("screen11_clearTimeouts");
	clearTimeout(screen11TM_weakness);
	clearTimeout(screen11TM_urinating);
	clearTimeout(screen11TM_vomiting);
	clearTimeout(screen11TM_dehydration);
	clearTimeout(screen11TM_heavybreathing);		
}

